import React, { useState } from 'react';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom'; 
import HappyKids from './pages/HappyKids'; // Import the HappyKids component

function App() {
  const [events] = useState([
    { id: 1, title: 'Foster for Kitten or Cat', date: '12-02-2025' },
    { id: 2, title: 'Happy Kids', date: '01-03-2025' },
    { id: 3, title: 'Save the world', date: '22-04-2025' },
  ]);

  return (
    <BrowserRouter>
      <div className="App">
        {/* Header Section */}
        <header className="header">
          <div className="home">
            <p>SHARE-CARE</p>
          </div>
        </header>

        {/* Main Content */}
        <main className="main-content">
          <section className="events">
            <h2>Upcoming Events</h2>
            <ul>
              {events.map((event) => (
                <li key={event.id}>
                  <Link to={`/event/${event.id}`}>
                    <h3>{event.title}</h3>
                  </Link>
                  <p>Date: {event.date}</p>
                </li>
              ))}
            </ul>
          </section>

          {/* Define Routes */}
          <Routes>
            <Route path="/event/2" element={<HappyKids />} /> {/* HappyKids event route */}
            {/* Other event routes can be added here as needed */}
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}

export default App;
